import React, { Component } from "react";
import "./Tab.css";

export default class Tab extends Component {
  clickHandler() {
    console.log("Tab Child component clicked");
  }

  render() {
    return (
      <div className="tab" onClick={this.clickHandler}>
        Tab {this.props.index}
      </div>
    );
  }
}
